expectDenoKvResult(deleteResult).ok();

// For ATOMIC result - returns DenoKvAtomicResultExpectation
const atomicResult = await kv.atomic().set(["counter"], 1).commit();
expectDenoKvResult(atomicResult).ok().hasVersionstamp();
